import React, { Component } from "react";
import { Casa } from "../../backend/entidades/casas";

export class AdicionarHospedagem extends Component<{}, Casa> {
  constructor(props: Casa) {
    super(props);
    this.state = {
      id: "",
      imagem: "",
      titulo: "",
      descricao: "",
      diaria: 0,
      cidade: "",
      estado: "",
    };

    this.render = () => {
      return (
        <div>
          <h1>Adicionar Hospedagem</h1>
          <form>
            <label>Imagem:</label>
            <input type="text" name="imagem" value={this.props.chi}/>
            <label>Titulo:</label>
            <input type="text" name="titulo" />
            <label>Descricao:</label>
            <input type="text" name="descricao" />
            <label>Diaria:</label>
            <input type="text" name="diaria" />
            <label>Cidade:</label>
            <input type="text" name="cidade" />
            <label>Estado:</label>
            <input type="text" name="estado" />
            <button>Enviar</button>
          </form>
        </div>
      );
    };
  }
}
